import React from 'react'
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import notes from "../notes";





const Kepper = notes.map(function(note) {
    return (
        <Note 
            key = {note.key}
            title ={note.title}
            content = {note.content}
        />
    );
})

function App() {
    return (
        <div>
           <Header/> 

          <dl>{kepper}</dl> 
           <Footer/>
        </div>
    );
}

export default App;
